import React, { Component } from "react";
import Info from "./memberInfo";
class ListButton extends Component {
  constructor() {
    super();
    this.state = { infoItem: null ,number:0};
    this.clickEvent = this.clickEvent.bind(this);
  }
  clickEvent() {
    this.setState((previousNumber) => {
      return { number: previousNumber.number + 1 };
    });
    Info.map((member)=>{return member[this.state.number]})
  }
  render() {
    return (
      <div>
        <button type="button" class="btn btn-info" onClick={this.clickEvent}>
          {this.state.number}...................................
        </button>
      </div>
    );
  }
}
export default ListButton;
